import React from 'react'

const Insert = () => {
    const onInsert=(e)=>{
        e.preventDefault();
    }
  return (
    <div>
        <h1>주소 등록</h1>
        <form onSubmit={onInsert}>
            <input placeholder='이름'/>
            <hr/>
            <input placeholder='주소'/>
            <hr/>
            <button>등록</button>
            <button type='reset'>취소</button>
        </form>
    </div>
  )
}

export default Insert;
